import "./Styles.css";

const Timebar = () => {
  let currentDate = new Date();
  let newDate;
  let week = [{}];
  for (var i = 0; i <= 6; i++) {
    newDate = new Date(
      currentDate.getFullYear(),
      currentDate.getMonth(),
      currentDate.getDate() + i
    );

    week.push({date:newDate.toDateString(),id:i});
  }
  return (
    <div>
      <table>
        <tr>
          <th>Center Name</th>
          {week.map((day) => {
            <th key={day.id}>{day.date}</th>
          })}
        </tr>
      </table>
    </div>
  );
};

export default Timebar;
